import React from 'react';

const About = ({ setCurrentPage }) => {
  const handleLinkClick = (page) => {
    setCurrentPage(page);
  };

  return (
    <>
      <header>
        <h1>About Me</h1>
        <nav>
          <ul>
            <li>
              <button
                style={buttonStyle}
                onClick={() => handleLinkClick('home')}
              >
                Home
              </button>
            </li>
            <li>
              <button
                style={buttonStyle}
                onClick={() => handleLinkClick('about')}
              >
                About
              </button>
            </li>
            <li>
              <button
                style={buttonStyle}
                onClick={() => handleLinkClick('projects')}
              >
                Projects
              </button>
            </li>
            <li>
              <button
                style={buttonStyle}
                onClick={() => handleLinkClick('contact')}
              >
                Contact
              </button>
            </li>
          </ul>
        </nav>
      </header>

      <section>
        <div style={imageContainerStyle}>
          <img
            src={require('./images/psu.png')}
            alt="Psu"
            style={imageStyle}
          />
          <img
            src={require('./images/eagles.png')}
            alt="Go birds"
            style={imageStyle}
          />
          <img
            src={require('./images/fightins.png')}
            alt="Phillies"
            style={imageStyle}
          />
          <img
            src={require('./images/sixers.png')}
            alt="76ers"
            style={imageStyle}
          />
          <img
            src={require('./images/flyers.png')}
            alt="Flyers"
            style={imageStyle}
          />
        </div>
      </section>
    </>
  );
};

const buttonStyle = {
  padding: '10px 50px',
  backgroundColor: '#556',
  color: '#fff',
  border: 'none',
  borderRadius: '10px',
  cursor: 'pointer',
};

const imageContainerStyle = {
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
};

const imageStyle = {
  width: '100%',
  height: '300px',
  objectFit: 'cover',
};

export default About;
